import { LayoutComponents } from "../../components/LayoutComponents";
import { useContext } from 'react';
import { AuthContext } from '../../contexts/auth';
import "./styles.css";

export const Dashboard = () => {
  const { logout } = useContext(AuthContext);

  const handleLogout = () => {
    logout();
  }

  return (
    <LayoutComponents>
      <div className="clientes">
        <div className="clientes-cabecalho">
          <h1 className="clientes-titulo">Clientes</h1>
          <button className="botao-logout" onClick={handleLogout}>Sair</button>
        </div>
        <div className="clientes-conteudo">
          <input
            className="clientes-conteudo-input"
            type="text"
            name="name"
            placeholder="Nome"
          />
          <input
            className="clientes-conteudo-input"
            type="email"
            name="email"
            placeholder="Email"
          />
          <input
            className="clientes-conteudo-input"
            type="text"
            name="telefone"
            placeholder="Telefone"
          />
          <button className="botao-cadastro">Cadastrar</button>
        </div>
      </div>

    </LayoutComponents>
  );
}
